package com.alphalogicadmin.model;

public class CustomerPersonalInfo {

	public CustomerPersonalInfo() {
		// TODO Auto-generated constructor stub
	}

	private String cPhoneNo;
	private String cCity;
	private String cAddress1;
	private String cAddress2;
	private String cPostalCode;
	public String getcPhoneNo() {
		return cPhoneNo;
	}
	public void setcPhoneNo(String cPhoneNo) {
		this.cPhoneNo = cPhoneNo;
	}
	public String getcCity() {
		return cCity;
	}
	public void setcCity(String cCity) {
		this.cCity = cCity;
	}
	public String getcAddress1() {
		return cAddress1;
	}
	public void setcAddress1(String cAddress1) {
		this.cAddress1 = cAddress1;
	}
	public String getcAddress2() {
		return cAddress2;
	}
	public void setcAddress2(String cAddress2) {
		this.cAddress2 = cAddress2;
	}
	public String getcPostalCode() {
		return cPostalCode;
	}
	public void setcPostalCode(String cPostalCode) {
		this.cPostalCode = cPostalCode;
	}
	
	
	
	
}
